import React from 'react';
import './index.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";/* bootstrap 5 import  css*/
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";/* bootstrap 5 import js */
import Home from './Home';
import Services from './Services';
import About from './About';
import Contact from './Contact';
import { Switch ,Route,Redirect } from 'react-router-dom';
import NavBar from './NavBar';






const App = () =>{
  return(<>
<NavBar/>

  <Switch> 
  <Route exact  path ="/" component={Home } /> /* defaulf home page in load time in browser */
  <Route exact path ="/services" component={Services} /> /*  Services page in load  in browser */
  <Route  exact path ="/about" component={About} /> /* About page in load time in browser */
  <Route exact path ="/contact" component={Contact} /> /* Contact page in load in browser */
<Redirect to= "/" />/* incorrect path is write in url redirect to home page */

  </Switch>





  </>)

}
export default App;
